import{_ as a,c as t,o,ag as i}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP OPERATOR FAMILY","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_OPERATOR_FAMILY.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_OPERATOR_FAMILY.md"}'),s={name:"docs/7x/ref_guide/sql_commands/DROP_OPERATOR_FAMILY.md"};function n(r,e,d,l,p,c){return o(),t("div",null,e[0]||(e[0]=[i('<h1 id="drop-operator-family" tabindex="-1">DROP OPERATOR FAMILY <a class="header-anchor" href="#drop-operator-family" aria-label="Permalink to &quot;DROP OPERATOR FAMILY&quot;">​</a></h1><p>Removes an operator family.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP OPERATOR FAMILY [IF EXISTS] &lt;name&gt; USING &lt;index_method&gt; [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP OPERATOR FAMILY</code> drops an existing operator family. To run this command you must be the owner of the operator family.</p><p><code>DROP OPERATOR FAMILY</code> includes dropping any operator classes contained in the family, but it does not drop any of the operators or functions referenced by the family. If there are any indexes depending on operator classes within the family, you will need to specify <code>CASCADE</code> for the drop to complete.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the operator family does not exist. A notice is issued in this case.</p><p>name : The name (optionally schema-qualified) of an existing operator family.</p><p>index_method : The name of the index access method the operator family is for.</p><p>CASCADE : Automatically drop objects that depend on the operator family, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the operator family if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the B-tree operator family <code>float_ops</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP OPERATOR FAMILY float_ops USING btree;</span></span></code></pre></div><p>This command will not succeed if there are any existing indexes that use the operator family. Add <code>CASCADE</code> to drop such indexes along with the operator family.</p><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>DROP OPERATOR FAMILY</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_OPERATOR_FAMILY.html">ALTER OPERATOR FAMILY</a>, <a href="./CREATE_OPERATOR_FAMILY.html">CREATE OPERATOR FAMILY</a>, <a href="./ALTER_OPERATOR_CLASS.html">ALTER OPERATOR CLASS</a>, <a href="./CREATE_OPERATOR_CLASS.html">CREATE OPERATOR CLASS</a>, <a href="./DROP_OPERATOR_CLASS.html">DROP OPERATOR CLASS</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',22)]))}const R=a(s,[["render",n]]);export{m as __pageData,R as default};
